import React from "react";
import ReactDom from "react-dom";

ReactDom.render(
  // React.fragment is a replacement of
  <React.Fragment>
    <h1> Pawan Chauhan </h1>
    <p>Hanji Main Hoon Khalnayak</p>
    <h2>Nahi Tum Nahi Ho Khalnayak</h2>
    <p>Ku Main ku nahi hoon Khalnayak</p>
  </React.Fragment>,
  document.getElementById("root")
);
